window.bookSummaryJSON = "<p>British bad boy Sterling Quinn needs a wife. After his great-grandfather, the former prince something or another, passes and leaves him millions, he's shocked to discover the massive inheritance has a clause - he needs to clean up his image and be married in order to receive his millions. </p> <p>When word gets out that this hottie has royal blood running through his veins, and is on the prowl for Mrs. Right, crazy ex-girlfriends, school-yard crushes, and thousands of other hopeful women flock to his doorstep. </p> <p>What he needs is a manager to help him sort through the clutter. </p> <p>Enter Camryn Palmer, PR executive. Camryn has had a front row seat to her friend Sterling's revolving-door of a love-life for years. But when she's hired to clean up his image and manage the hordes of women cruising through his bedroom door, she's stuck between a rock and a hard place. Literally. </p> <p>Yes, she has secret fantasies about being the one to keep his bed warm - what woman doesn't? He's sinfully attractive, and she wants to kiss that cocky English accent right off his lips, but she's got a job to do. She's a professional through and through, and besides, an arranged marriage could never be a happy one. Right? </p>"; 
